import React from 'react';
import './App.css';
import { Navbar } from './layouts/NavbarAndFooter/Navbar';
import { ExploreTopBook } from './layouts/NavbarAndFooter/HomePage/ExploreTopBook';
import { Carousel } from './layouts/NavbarAndFooter/HomePage/Carousel';
import { Heros } from './layouts/NavbarAndFooter/HomePage/Hores';
import { LibraryServices } from './layouts/NavbarAndFooter/HomePage/LibraryService';

function App() {
  return (
    <div>
      <Navbar></Navbar>
      <ExploreTopBook></ExploreTopBook>
      <Carousel></Carousel>
      <Heros></Heros>
      <LibraryServices></LibraryServices>
    </div>

  );
}

export default App;
